var tipuesearch = {"pages": [{'title': '各組期末報告說明', 'text': '', 'tags': '', 'url': '各組期末報告說明.html'}, {'title': '執行規劃', 'text': '', 'tags': '', 'url': '執行規劃.html'}, {'title': '手足球系統模擬', 'text': '動機: \n \xa0 \xa0 近年來科技發展，程式設計與系統模擬早以統合成一塊。本學期的手足球模擬，跳脫以往人 v.s. 人的競賽方式，以及人 v.s. 電腦，我們也想做出電腦 v.s. 電腦的系統模擬，其動機為前陣子 Alpha go \xa0 擊敗不少各國高手，這讓我們想驗證電腦與電腦是否能力相當，又會如何運作；而中間使用的運算法並沒有 Alpha go \xa0 這麼複雜，但在機構設計以及運動模擬中佔了很大一部分，而我們認為電腦 v.s. 電腦的程式雖可以設計，但中間是否參雜些運氣成分還有待關注。 \n', 'tags': '', 'url': '手足球系統模擬.html'}, {'title': '專案成果摘要', 'text': '', 'tags': '', 'url': '專案成果摘要.html'}, {'title': '相關文獻探討', 'text': '', 'tags': '', 'url': '相關文獻探討.html'}, {'title': '專案執行成員', 'text': '', 'tags': '', 'url': '專案執行成員.html'}, {'title': '執行使用套件', 'text': '\n \n \n 套件名稱 \n 介紹 \n 功能 \n \n \n V-rep \n \n VREP集成了建模 / 编程 / 物理引擎。具有四款物理引擎， Bullet/ODE/Vortex/Newton 。 \n 其開源、快速、靈活的建模和模擬，同時有一定的模擬精度，為研發中非常重要的一部分。 \n 特色 : \n \n 建模和编程環境方便。 \n \n \xa0 \xa0 2. VREP本身是開源的。使用 LUA 语言进行编程。 \n (LUA 是一個體積很小的编程语言，但集成了 C 語言， Python ， Matlab 等等其他主流语言，使用上相對容易 ) \n \n \n 1.跨平台 \n 2.六種編成方法 \n 3.多種編成語言 \n 4.完整的運動學計算器 \n 5.路徑規劃 \n 6.與現實接近的傳感器 \n (在檢測區域中的最短距離計算) \n \n \n \n OnShape \n \n Onshape 只要打開瀏覽器即可使用，使用的永遠都是最新版本，因此兼容性不會成為問题。 \n Onshape 具備了有限的實體建模能力，其幾何實體是由  Part Studio  這個多部件幾何體開發環境來生成的，没有文件的概念，因此也没有外部参照的依赖性问题。 \n 特色 : \n 1.線上協同設計。 \n 2.容易上手的建模策略3.設計流程的重視。 \n \n \n 繪圖功能其他繪圖軟體並無太大差異，其不同點在於 : \n 1.\xa0 比較指令 \n 2.\xa0 跟隨模式 \n 3.\xa0 匯入 / 導入 DXF 檔案 \n 4.\xa0 捷徑工具列 \n 5.\xa0 加入評論 \n 6.\xa0 插入時的快照模式 \n \n \n \n Github \n \n GitHub是透過 Git 進行 版本控制 的軟體原始碼代管服務平台，由 GitHub 公司的開發者使用 Ruby on Rails 編寫而成。 \n 特色 : \n 1.提供付費帳戶和免費帳戶。 \n 2.GitHub也提供了圖表功能。 \n 3.Git 程式碼擁有開放和公開散播能力極佳的特性，提供了社群互動功能。 \n \n \n GitHub 支援以下格式和功能： \n 1.文件：包括自動生成的、採用類 Markdown 語言的 Readme 檔案。 \n 2.問題追蹤系統（同時可用於功能需求） \n 3. Wiki \n 4.GitHub Pages支援用戶透過軟體倉庫建立靜態網站或靜態部落格。 \n 5. 任務列表 \n 6. 甘特圖 \n \n \n CMSimfly \n \n 是一套簡單的網際內容管理系統 ,  採用  Flask  網際框架 ,  以  Beautifulsoup  解讀分頁內容 . \n以  Python 3  編寫 ,  利用  Flask  網路框架可以在伺服器運行 ,  讓使用者利用瀏覽器擷取動態  WWW  伺服器所送至近端的  html  加上  Javascript  程式碼 ,  然後在瀏覽器中顯示網際內容編輯器。 \n 1.建立可攜環境後即可多人協同 \n \n \n \n', 'tags': '', 'url': '執行使用套件.html'}, {'title': '專案執行過程規劃', 'text': '', 'tags': '', 'url': '專案執行過程規劃.html'}, {'title': '專案執行內容', 'text': '', 'tags': '', 'url': '專案執行內容.html'}, {'title': '專案討論', 'text': '\n', 'tags': '', 'url': '專案討論.html'}, {'title': '設計與繪圖', 'text': '', 'tags': '', 'url': '設計與繪圖.html'}, {'title': '零組件尺寸分析', 'text': '手足球系統的零組件尺寸分析 (可行性分析) \n', 'tags': '', 'url': '零組件尺寸分析.html'}, {'title': '參數設計與繪圖', 'text': '手足球系統的零組件參數設計與繪圖 (零組件初步設計繪圖) \n Onshape 零組件連結 \n', 'tags': '', 'url': '參數設計與繪圖.html'}, {'title': '細部設計與BOM', 'text': '手足球零件格式說明 \n 手足球零件格式說明 \n 零件 BOM \n 手足球零組件材料表 (含零組件下載連結) \n 零件尺寸圖 \n \n 零件部分組裝圖 \n 零件部分組裝圖 \n 3D 零組件爆炸圖 \n 3D 零組件爆炸圖 \n', 'tags': '', 'url': '細部設計與BOM.html'}, {'title': 'V-rep 動態模擬', 'text': '', 'tags': '', 'url': 'V-rep 動態模擬.html'}, {'title': '送球機構設計與模擬', 'text': '', 'tags': '', 'url': '送球機構設計與模擬.html'}, {'title': '系統功能展示', 'text': '手足球模擬系統功能展示 (模擬展示與說明影片) \n', 'tags': '', 'url': '系統功能展示.html'}, {'title': '結案報告', 'text': '', 'tags': '', 'url': '結案報告.html'}, {'title': '專案口頭簡報', 'text': '各組利用倉儲中的 Reveal.js 進行結案簡報 (結案口頭簡報) \n', 'tags': '', 'url': '專案口頭簡報.html'}, {'title': '專案報告書', 'text': '各組完成 html 與 pdf 格式之手足球專案結案報告 (文字結案報告書) \n', 'tags': '', 'url': '專案報告書.html'}]};